    "6bc95c88-35f6-4dc7-8d39-dfe2b43a2d9e": {"id":"6bc95c88-35f6-4dc7-8d39-dfe2b43a2d9e","project_id":14253,"key":36551688,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:20.772Z","updated_at":"2022-09-25T21:29:20.772Z","props":{"content":"\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003eUnfortunately Jo has become another phishing victim. She’s just given her Office 365 password to hackers. They can now access her email accounts and every document she keeps on the cloud via OneDrive.\u003c/div\u003e"},"type":"Text"}, 
    "2d0047b2-3dd3-4172-bd1c-70bf003db543": {"id":"2d0047b2-3dd3-4172-bd1c-70bf003db543","project_id":14253,"key":36551687,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:20.766Z","updated_at":"2022-09-25T21:29:20.766Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eUh oh!\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eAlways take a moment before clicking on any links in an email. Jo should simply click on ‘Report Spam’ if she suspects a phishing attack.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eWe’ll look at the things we can do and check to make sure we’re not opening ourselves up to cyber threats.\u003cbr/\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eFirst, let’s see what happens if Jo does click on the ‘Send Again’ link.\u003c/p\u003e","text":"Uh oh!\n\nAlways take a moment before clicking on any links in an email. Jo should simply click on ‘Report Spam’ if she suspects a phishing attack.\n\nWe’ll look at the things we can do and check to make sure we’re not opening ourselves up to cyber threats.\n\nFirst, let’s see what happens if Jo does click on the ‘Send Again’ link."},"type":"Text"}, 
