    "669e3d62-9579-4176-993e-b0430b73088e": {"id":"669e3d62-9579-4176-993e-b0430b73088e","project_id":14253,"key":36551685,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:20.752Z","updated_at":"2022-09-25T21:29:20.752Z","props":{"content":"\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cstrong data-type=\"bold\"\u003eSpot on!\u003c/strong\u003e\u003c/div\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003eAlways take a moment before clicking on any links in an email. Jo should simply click on ‘Report Spam’ or \u0026#x27;Report Message\u0026#x27; if she suspects a phishing attack.\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003eWe’ll look at the things we can do and check to make sure we’re not opening ourselves up to cyber threats.\u003c/div\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003eFirst, let’s see what happens if Jo does click on the ‘Send Again’ link.\u003c/div\u003e\u003c/div\u003e","text":"Spot on!\n\nAlways take a moment before clicking on any links in an email. Jo should simply click on ‘Report Spam’ or 'Report Message' if she suspects a phishing attack.\n\nWe’ll look at the things we can do and check to make sure we’re not opening ourselves up to cyber threats.\n\nFirst, let’s see what happens if Jo does click on the ‘Send Again’ link."},"type":"Text"}, 
