    "fab9b57f-e093-4b9f-b8ec-b37114f9a76e": {"id":"fab9b57f-e093-4b9f-b8ec-b37114f9a76e","project_id":14253,"key":36551680,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:20.721Z","updated_at":"2022-09-25T21:29:20.721Z","props":{"content":"\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003eEven though Frank is on his mobile he can still check the ‘display name’ of the sender and the embedded link. \u003c/div\u003e\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003eBy selecting the email and then the display address he can see that the email is from a phishy-looking Gmail address.\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003eBy pressing and holding the link in the email he can also see that the URL has no relation to Ireland or lotteries at all. \u003c/div\u003e\u003c/div\u003e\u003c/div\u003e\u003c/div\u003e\u003c/div\u003e\u003c/div\u003e\u003c/div\u003e\u003c/div\u003e\u003c/div\u003e\u003c/div\u003e","text":"Even though Frank is on his mobile he can still check the ‘display name’ of the sender and the embedded link. \n\nBy selecting the email and then the display address he can see that the email is from a phishy-looking Gmail address.\n\nBy pressing and holding the link in the email he can also see that the URL has no relation to Ireland or lotteries at all. "},"type":"Text"}, 
    "68f814b5-5d28-4c7b-ba48-b158e3ef2d2d": {"id":"68f814b5-5d28-4c7b-ba48-b158e3ef2d2d","project_id":14253,"key":36551679,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:20.716Z","updated_at":"2022-09-25T21:29:20.716Z","props":{"content":"\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003eEven though Frank is on his mobile he can still check the ‘display name’ of the sender and the embedded link. \u003c/div\u003e\u003c/div\u003e\u003c/div\u003e\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003eBy selecting the email and then the display address he can see that the email is from a phishy-looking Gmail address.\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003eBy pressing and holding the link in the email he can also see that the URL has no relation to Ireland or lotteries at all. \u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003eSorry Frank, \u0026#x27;Report Spam\u0026#x27; or \u0026#x27;Report Message\u0026#x27; and keep working for a few more years.\u003c/div\u003e\u003c/div\u003e","text":"Even though Frank is on his mobile he can still check the ‘display name’ of the sender and the embedded link. \n\nBy selecting the email and then the display address he can see that the email is from a phishy-looking Gmail address.\n\nBy pressing and holding the link in the email he can also see that the URL has no relation to Ireland or lotteries at all. \n\nSorry Frank, 'Report Spam' or 'Report Message' and keep working for a few more years."},"type":"Text"}, 
