    "b539de93-5cb0-4448-847b-234709e695db": {"id":"b539de93-5cb0-4448-847b-234709e695db","project_id":14253,"key":36551070,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:16.558Z","updated_at":"2022-09-25T21:29:16.558Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003ePhishing – identify it\u003c/h1\u003e\u003ch3 data-type=\"heading-three\"\u003e\u003c/h3\u003e\u003ch3 data-type=\"heading-three\"\u003e\u003cspan style=\"font-size:16px\" data-type=\"fontSize\"\u003eJo had a “Send Again” button in her phishing email that redirected her to a fraudulent site. \u003c/span\u003e\u003c/h3\u003e\u003ch3 data-type=\"heading-three\"\u003e\u003cspan style=\"font-size:16px\" data-type=\"fontSize\"\u003e\u003c/span\u003e\u003c/h3\u003e\u003ch3 data-type=\"heading-three\"\u003e\u003cspan style=\"font-size:16px\" data-type=\"fontSize\"\u003eWatch out for hyperlinks and ‘go-to’ buttons.  If the link looks dodgy and doesn’t match the sender’s URL then beware.\u003c/span\u003e\u003c/h3\u003e\u003cp\u003e\u003cspan style=\"font-size:16px\" data-type=\"fontSize\"\u003e\u003c/span\u003e\u003c/p\u003e\u003ch3 data-type=\"heading-three\"\u003e\u003cspan style=\"font-size:16px\" data-type=\"fontSize\"\u003eOn laptops/desktops you can hover over buttons and links to see the actual embedded link. \u003cbr/\u003e\u003c/span\u003e\u003c/h3\u003e\u003cp\u003e\u003cspan style=\"font-size:16px\" data-type=\"fontSize\"\u003eOn mobile devices you can’t hover but you can press and hold a link and this will show you the real embedded address.\u003c/span\u003e\u003c/p\u003e"},"type":"Text"}, 
