    "173fd866-cc48-4eb7-a465-d6a46cab47a3": {"id":"173fd866-cc48-4eb7-a465-d6a46cab47a3","project_id":14253,"key":36550726,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:14.297Z","updated_at":"2022-09-25T21:29:14.297Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThis is phishing personalised and targeted to a specific victim. Hackers get personal details often from social media and then use this to ‘bait’ the person.\u003cbr/\u003e\u003c/p\u003e"},"type":"Text"}, 
    "f2ce8985-bb9f-4e59-84f4-47a7e25d292a": {"id":"f2ce8985-bb9f-4e59-84f4-47a7e25d292a","project_id":14253,"key":36550725,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:14.292Z","updated_at":"2022-09-25T21:29:14.292Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003ePhishing – identify it\u003c/h1\u003e\u003ch3 data-type=\"heading-three\"\u003e\u003c/h3\u003e\u003ch3 data-type=\"heading-three\"\u003eJo could have easily spotted that she was being scammed with a phishing attack by checking more carefully on who sent the email.\u003cbr/\u003e\u003c/h3\u003e\u003ch3 data-type=\"heading-three\"\u003eOn many laptops and desktops your inbox won’t show the full sender’s address. You may only see the friendly ‘display name’ of a sender and this can look legitimate even when the address is not. Here’s one way to check the full address…\u003cbr/\u003e\u003c/h3\u003e"},"type":"Text"}, 
    "ca9e2228-d0cf-475a-9e38-af73a527b6f4": {"id":"ca9e2228-d0cf-475a-9e38-af73a527b6f4","project_id":14253,"key":36550724,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:14.287Z","updated_at":"2022-09-25T21:29:14.287Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003ePhishing – identify it\u003c/h1\u003e\u003ch3 data-type=\"heading-three\"\u003e\u003c/h3\u003e\u003ch3 data-type=\"heading-three\"\u003eIf Jo checks her emails on her mobile she’ll probably only see the display address but she can still check the full address. How she does this depends on her device, email app and settings. \u003c/h3\u003e\u003ch3 data-type=\"heading-three\"\u003e\u003c/h3\u003e\u003ch3 data-type=\"heading-three\"\u003eHere’s one way to check…\u003cbr/\u003e\u003c/h3\u003e"},"type":"Text"}, 
