    "db5b55c2-4936-48ff-85b1-c49e94ae35ce": {"id":"db5b55c2-4936-48ff-85b1-c49e94ae35ce","project_id":14253,"key":36550623,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:13.673Z","updated_at":"2022-09-25T21:29:13.673Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#87189d\" data-type=\"color\"\u003ePhishing – identify it\u003c/span\u003e\u003c/strong\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eScammers can also cause a world of pain by getting you to open attachments to emails. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOnce opened these can introduce malware onto your system. Some examples can steal information, others can lock you out of files so that you need to pay a ransom to regain access.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eOnly ever open attachments from trusted senders.\u003c/strong\u003e\u003c/p\u003e"},"type":"Text"}, 
