    "f57feb57-573a-4a88-920b-213aeb283f6a": {"id":"f57feb57-573a-4a88-920b-213aeb283f6a","project_id":14253,"key":36550521,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:13.044Z","updated_at":"2022-09-25T21:29:13.044Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThat\u0026#x27;s Right.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eHelen is certain this is a phishing scam and she hasn’t opened any links or passed on any information.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eHer next step is to report this email using the ‘Report Scam’ button in her email application. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eForwarding the email anywhere else puts other people at risk of opening the link and potentially falling for the scam.\u003c/p\u003e"},"type":"Text"}, 
