    "efbd9e11-52cc-4ba0-bd8d-79f5e0d4b5e9": {"id":"efbd9e11-52cc-4ba0-bd8d-79f5e0d4b5e9","project_id":14253,"key":36550459,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:12.631Z","updated_at":"2022-09-25T21:29:12.631Z","props":{"content":"\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003eYou saw Jo fall for the classic email phishing ‘bait’ of clicking on a fraudulent link. This allowed hackers to access confidential and privileged information for their own criminal means. \u003c/span\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003eThis is phishing … stealing sensitive information such as usernames, passwords, financial details and other privileged data for malicious reasons. Criminals achieve this by disguising links – ‘hooks’ – as if they’re from trustworthy people or organisations. \u003c/span\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003eOnce in your device, laptop or desktop, they can cause significant harm and havoc to private individuals and to our organisation as a whole. \u003c/span\u003e\u003c/div\u003e"},"type":"Text"}, 
