    "b8beb6c8-5883-4af8-af3b-cbfeef266c39": {"id":"b8beb6c8-5883-4af8-af3b-cbfeef266c39","project_id":14253,"key":36550404,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:12.153Z","updated_at":"2022-09-25T21:29:12.153Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eHackers love to trick people into thinking that a message is from an institution with authority. These often make you fearful by telling you to pay a fine or act now to avoid some other fake punishment.\u003c/p\u003e"},"type":"Text"}, 
    "5f08219d-f694-468c-9ae3-b16b00f18141": {"id":"5f08219d-f694-468c-9ae3-b16b00f18141","project_id":14253,"key":36550403,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:12.118Z","updated_at":"2022-09-25T21:29:12.118Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eBanks will never ask you to send them your PIN, password or account details. Similarly, a reputable company should never send an email asking for your password, credit card number, or the answer to a security question. \u003c/p\u003e"},"type":"Text"}, 
    "ddf3ced4-65c5-4d0b-a3b6-1ed7ef1cd860": {"id":"ddf3ced4-65c5-4d0b-a3b6-1ed7ef1cd860","project_id":14253,"key":36550402,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:12.077Z","updated_at":"2022-09-25T21:29:12.077Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eAustralia Post emails asking you to pay $5 so that a package can be delivered. “Click on the link to add personal information including credit card details”. However, you’re not expecting any deliveries! If you get a message telling you about something you didn’t do – like buying a lottery ticket – then it’s most likely a phishing scam.\u003c/p\u003e"},"type":"Text"}, 
