    "074bc8d7-44d0-44e8-982e-9cc232d800fe": {"id":"074bc8d7-44d0-44e8-982e-9cc232d800fe","project_id":14253,"key":36550765,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:14.520Z","updated_at":"2022-09-25T21:29:14.520Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"font-size:14px\" data-type=\"fontSize\"\u003eThe phone/voice version of phishing. Hackers get PINs, passwords and other sensitive information during a phone call. They may pretend to be from a bank, government department or some other type of trusted organisation.\u003c/span\u003e\u003c/p\u003e"},"type":"Text"}, 
    "1a0200ba-bbe8-4e89-9438-3aa1d3d32532": {"id":"1a0200ba-bbe8-4e89-9438-3aa1d3d32532","project_id":14253,"key":36550764,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:14.509Z","updated_at":"2022-09-25T21:29:14.509Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eSMS phishing. Malicious links can also be sent via an SMS message with the same results as those sent via email. \u003c/p\u003e"},"type":"Text"}, 
