    "1c11643c-537c-4626-bd55-735e7db36792": {"id":"1c11643c-537c-4626-bd55-735e7db36792","project_id":14253,"key":36550762,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:14.498Z","updated_at":"2022-09-25T21:29:14.498Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eBanks will never ask you to send them your PIN, password or account details. Similarly, a reputable company should never send an email asking for your password, credit card number, or the answer to a security question. \u003c/p\u003e"},"type":"Text"}, 
    "40a8008e-88bb-427a-b097-089a8430178e": {"id":"40a8008e-88bb-427a-b097-089a8430178e","project_id":14253,"key":36550761,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:14.493Z","updated_at":"2022-09-25T21:29:14.493Z","props":{"src":"images/image_92.png","imageId":92},"type":"Image"}, 
    "5ab6bf71-bd7c-473e-8c99-1dd9f599bf7c": {"id":"5ab6bf71-bd7c-473e-8c99-1dd9f599bf7c","project_id":14253,"key":36550760,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-25T21:29:14.488Z","updated_at":"2022-09-25T21:29:14.488Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eAustralia Post emails asking you to pay $5 so that a package can be delivered. “Click on the link to add personal information including credit card details”. However, you’re not expecting any deliveries! If you get a message telling you about something you didn’t do – like buying a lottery ticket – then it’s most likely a phishing scam.\u003c/p\u003e"},"type":"Text"}, 
